import { Link } from "react-router-dom";
import ImageSlider from "react-simple-image-slider";
export default function(){
    const SliderImage=[{
        url:"https://image.ibb.co/f0hhZc/bp.jpg"
    },
{
    url:"https://image.ibb.co/gC9PfH/dw.jpg"
},

{
    url:"https://image.ibb.co/dQwWSx/coco.jpg"
},]
return(<>
    <div className="row" style={{backgroundColor:"rgb(54,69,79)",minHeight:"40px",paddingLeft:"50px"}}>
        <div className="col-xs-6 col-sm-4" style={{padding:"10px",textAlign:"center"}}><Link to="/LatestMovies" style={{color:"white"}}>Latest Movies</Link></div>
        <div className="col-xs-6 col-sm-4" style={{padding:"10px",textAlign:"center"}}><Link to="/UpcomingMovies" style={{color:"white"}}>Upcoming Movies</Link></div>
        <div className="col-xs-6 col-sm-4" style={{padding:"10px",textAlign:"center"}}><Link to="/NearByEvents"  style={{color:"white"}}>Near By Event</Link></div>
    </div>
    
     <ImageSlider className="container-fluid"
     width={1535}
     height={600}
     images={SliderImage}
     showNavs={true}
     showBullets={true}
     autoPlay={true}
     />
      

 
</>)
}
